var registerOfer;
var saveOffer = () => {
    $('#saveOfferbtn').attr("disabled", true);
    $("#saveOfferbtn").html('Cargando...');
    $.ajaxSetup({
        headers: {
            'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
        }
    });
    $.ajax({
        method: "POST",
        url: registerOfer,
        data: $("#formcreateoffer").serialize(),
    }).done((res) => {
        //Si la respuesta del controlador es correcta, muestra un modal de informacion que recarga la pagina.
        if (res.mensaje == "errorEmail") {
            document.getElementById('email').focus();
            $('.email-error').show();
            $('#saveOfferbtn').attr("disabled", false);
            $("#saveOfferbtn").html('Guardar');
            $('.nit-error').hide();
            $('.name-error').hide();

        } else if (res.mensaje == "errorNit") {
            $('.nit-error').show();
            $('#saveOfferbtn').attr("disabled", false);
            $("#saveOfferbtn").html('Guardar');
            $('.email-error').hide();
            $('.name-error').hide();
        } else if (res.mensaje == "errorEmpresa") {
            $('.name-error').show();
            $('#saveOfferbtn').attr("disabled", false);
            $("#saveOfferbtn").html('Guardar');
            $('.email-error').hide();
            $('.nit-error').hide();
        } else {
            swal({
                html: true,
                title: "Proceso Exitoso",
                text: "Se ha creado una nueva entidad financiera y se ha enviado la informacin de contacto al correo electrnico.<br><br><strong>Usuario: </strong>"+ res.usuario + "<br><strong>Clave: </strong>" + res.clave,
                type: "success",
                buttons: true,
                buttons: {
                    confirm: "Aceptar",
                },
            }, function () {
                location.reload();
            });
        }

    }).fail((error) => {
        //Si la repuesta al controlador no es correcta, se muestra un modal con el error.
        $('#saveOfferbtn').attr("disabled", false);
        $("#saveOfferbtn").html('Guardar');
        swal("Oops...", "Verfica que se hayan completado todos los campos", "error");
    });

}



